BabyGotBoobs - Dayna Vendetta (The Woman Who Was Wronged)


On a hot summer day, Dayna decides to look for the man who did her wrong. She suspects that he is on the farm down the road, so she heads there to get her revenge. However, when she sees the perpetrator, she decides to let him do the right kind of wrong to her.
